import React from 'react';
import './App.css';
import Meme from './Meme';
import Jokes from './Jokes';
import Header from './Header';

const App = () => {

	const babi = Jokes.map((jokes) => {
		return (
				<Meme quote1={jokes.quote1} display1={jokes.display1} quote2={jokes.quote2} display2={jokes.display2} 
				imageURL={jokes.imageURL} />
		)
		})

return(
<div>
	<Header />

	<div className='flex-container'>
	{babi}
	</div>
</div>
)	

}

export default App;
